        <P class="p152 ft65">DRIVER CERTIFICATION FOR OTHER COMPENSATED WORK</P>
        <P class="p153 ft66">INSTRUCTIONS: When employed by a motor carrier, a driver must report to the carrier all <NOBR>on-duty</NOBR> time including time working for other employers. The definition of <NOBR>on-duty</NOBR> time found in Section 395.2 paragraphs (8) and (9) of the Federal Motor Carrier Safety Regulations includes time performing any other work in the capacity of, or in the employ or service of, a common, contract or private motor carrier, also performing any compensated work for any nonmotor carrier entity.</P>
        <TABLE cellpadding=0 cellspacing=0 class="t22">
