    <P class="p165 ft71">REQUIREMENTS</P>
    <P class="p166 ft71">___________________________________________________________</P>
    <P class="p167 ft72">The requirements in Part 383 apply to every driver who operates in intrastate, interstate, or foreign commerce and operates a vehicle weighing 26,001 pounds or more, can transport more than 15 people, or transports hazardous materials that require placarding.</P>
    <P class="p168 ft73">The requirements in Part 391 apply to every driver who operates in interstate commerce and operates a vehicle weighing 10,001 pounds or more, can transport more than 15 people, or transports hazardous materials that require placarding.</P>
    <P class="p169 ft73">DRIVER REQUIREMENTS: Parts 383 and 391 of the Federal Motor Carrier Safety Regulations contain some requirements that you as a driver must comply with. These requirements are in effect as of July 1, 1987. They are as follows:</P>
    <P class="p170 ft73">1.<SPAN class="ft74">POSSESS ONLY ONE LICENSE: </SPAN>You, as a commercial vehicle driver, may not possess more than one motor vehicle operator's license.</P>
    <P class="p171 ft73">If you have more than one license, keep the license from your state of residence and return the additional license to the states that issued them. DESTROYING a license does not close the record in the state that issued it; you must notify the state.</P>
    <P class="p172 ft73">If a multiple license has been lost, stolen, or destroyed, close your record by notifying the state of issuance that you no longer want to be licensed by the state.</P>
    <P class="p173 ft74"><SPAN class="ft73">2.</SPAN><SPAN class="ft75">NOTIFICATION OF LICENSE SUSPENSION, REVOCATION OR CANCELLATION:</SPAN><SPAN class="ft73">Sections 392.42 and 383.33 of the</SPAN></P>
    <P class="p174 ft73">Federal Motor Carrier Safety Regulations require that you notify your employer the NEXT BUSINESS DAY of any revocation or suspension of your driver's license.</P>
    <P class="p175 ft72">In addition, Section 383.31 requires that any time you violate a state or local traffic law (other than parking), you must report it within 30 days to : 1) your employing carrier, and 2) the state that issued your license (if the violation occurs in a state other than the one which issued your license). The notification to both the employer and state must be in writing.</P>
